@Override
public int compareValues(BytesRef val1, BytesRef val2) {
  if (val1 == null) {
    if (val2 == null) {
      return 0;
    }
    return -1;
  } else if (val2 == null) {
    return 1;
  }
  return val1.compareTo(val2);
}

